import { Bar } from 'react-chartjs-2';
import array from './array';
import { Chart } from 'react-chartjs-2';
const MyChart = new Chart(ctx, {
    type: 'bar',
    data: array,
    options: {
        scales: {
            x: {
                stacked: true
            },
            y: {
                stacked: true
            }
        }
    }
});
y 

export default MyChart;
